using BenchmarkTools

function rle1(str)
    arr = []
    i = 1
    n = length(str)

    while i < n + 1
        j = i

        while j < n + 1 && str[i] == str[j]
            j += 1
        end

        push!(arr, (str[i], j - i))
        i = j
    end

    return arr
end

function rle2(str)
    arr = []
    i = 1

    while i < length(str) + 1
        j = i

        while j < length(str) + 1 && str[i] == str[j]
            j += 1
        end

        push!(arr, (str[i], j - i))
        i = j
    end

    return arr
end

str = "
"

println(@benchmark rle1(str))
